script: |
  super -f text -I q4849.spq | sort > q4849.out

inputs:
  - name: q4849.spq
    data: |
      SELECT - col0 + + + 68 / + CAST ( - + CAST ( + - col0 AS INTEGER ) AS REAL ) - - col2 * + col2 FROM tab0 (FORMAT parquet) WHERE NOT col2 - 69 IS NOT NULL;
  - name: tab0

outputs:
  - name: q4849.out
    data: |
